(32530, 58255, 0, 1, 'Gold', '閃耀的黃金\r\n火辣的女孩\r\n世人兩者都喜歡  \r\n\r\n我們都在這團迷霧中備受煎熬\r\n為什麼不享受人生，追求你心底更深層的東西呢', '2011-02-06 00:00:00', 2000, 20, 0, 1, 'Gold is shiny\r\n\r\nthat chick is pretty hot\r\n\r\nyou like em’ both but\r\n\r\nyou may be suffering cause’ it`s all smoke\r\n\r\nYou may believe in fate , but nothing comes out as planned\r\n\r\nwhy not enjoy life and go seeking for something\r\n\r\nit may be so hard , but it is really there.\r\n\r\ntrust me and believe yourself\r\n\r\nDont let others . Dont let others get you in snare.\r\n', '', 237, '', 'Long Hair Monster  長毛怪樂隊', 'Ah Bao& Guy', '', 'Indie', '', 0, 0, 1, '2011-02-06 02:10:33', '2013-10-07 17:18:01', '0000-00-00 00:00:00'),
(32531, 25248, 0, 1, '我想我需要找個人聊聊天只是你不會主動問我怎麼了', '歌名很長的一首歌，感謝StreetVoice的小樹推薦', '2010-11-16 00:00:00', 2000, 0, 1, 5, '失眠 一整頁的時間\r\n抽完 剩下半支煙\r\n勇氣 沉入海裡面\r\n現在 在哪邊\r\n\r\n三十 公尺那樣遙遠\r\n點燃 最後一個夜\r\n問題 不著邊界\r\n我想 不要睡\r\n\r\n我想我需要找個人聊聊天\r\n狀態卻永遠離線\r\n只是你不會主動問我怎麼了\r\n夏天秋天\r\n\r\n我想我需要找個人聊聊天\r\n沒有回應的撥出鍵\r\n只是你不會主動問我怎麼了\r\n春天冬天', '', 696, '', '小莫', '小莫', '莫以安', '挑嘴貓音樂工作室', '', 0, 1, 0, '2011-02-06 03:04:10', '2015-03-12 13:45:50', '0000-00-00 00:00:00'),
