(32540, 7548, 0, 1, '紅磚道', '一首思念家人與朋友的小品.', '2011-02-06 00:00:00', 0000, 0, 2, 4, '借者暖光借了溫暖  借者為哼一首歌也借著過往  \r\n冰冷的二月  想起事來  也有點難堪\r\n\r\n靠著模糊淡黃的記憶  溫馨的街道和著和煦的日光\r\n望著天空  浮著白雲  誰有翅膀  誰有翅膀(你有翅膀)  誰有翅膀(你有翅膀)\r\n\r\n看阿  這是現在的我  不是想閃躲  有些事是有點難承受\r\n回頭看吧  那種幸福  只是想~\r\n\r\n我也掛念  我也想念  你們還好嗎  只是很想說  I miss you\r\n我的好友  你們好嗎  I miss you  忍著不去講  但一切會更好吧  ~', '', 384, '', '家豪', '家豪', '深層', '獨立', '', 0, 1, 0, '2011-02-06 11:18:35', '2015-03-12 13:45:51', '0000-00-00 00:00:00'),
(32541, 7548, 0, 1, '放縱', '看者窗外的人,來回的穿梭著,一種令人迷失的感覺,但我似乎也感受到了自己的方向.', '2011-02-06 00:00:00', 0000, 0, 2, 4, '不停的看著窗外人們忙碌生活\r\n不斷的了解人們為何而追求\r\n促立於徬徨的茫茫人海之中\r\n我漸漸迷思了自我\r\n\r\n總是在一個人回到家的時候\r\n才能脫下虛偽的面具\r\n那個很疲憊卻最真實的自己\r\n一股強烈而且衝動的心靈\r\n慢慢釋放自己的感情\r\n向著心所要的去追\r\n\r\n我想要放縱自己 去過想要的生活\r\n找尋真正屬於自己的夢想\r\n我想要放縱自己 去過想要的生活\r\n找尋真正屬於自己的夢~~~\r\n\r\n', '', 236, '', '恩佑', '恩佑', '深層', '獨立', '', 0, 1, 0, '2011-02-06 11:19:19', '2015-03-12 13:45:51', '0000-00-00 00:00:00'),
(32542, 25248, 0, 1, '假文青', '', '2010-01-31 00:00:00', 2000, 0, 1, 5, '星期四的晚上總是想要找點樂子\r\n朋友們卻個個都不給面子\r\n不想呆在家裡當個植物當根樹枝\r\n這樣下去也許我會變顆礦石\r\n\r\n改不掉晚睡早起的生活方式\r\n天天都過著頹廢的頹廢的日子\r\n甘願當個笨蛋 當個傻子\r\n可是 不想活得像是個像個瞎子\r\n\r\n總是 想著不著邊際的問題 \r\n得到的 答案也都沒有什麼意義\r\n我就 像是一個神經病\r\n我想我就是個 假文青', '', 314, '', '小莫', '小莫', '莫以安', '', '', 0, 1, 0, '2011-02-06 16:21:50', '2015-03-12 13:45:51', '0000-00-00 00:00:00'),
