(32544, 26743, 0, 1, 'North Protect 北衛-Natural esthetics', '', '2011-02-06 00:00:00', 2000, 20, 0, 7, '生命漸漸失去溫度 顏色都褪的很模糊 城市的角度清楚了 劃出藍圖\r\n\r\n就讓我化作空氣無數細小分子 像種子 落地了 用力把生命揮霍成放肆 \r\n\r\n\r\n我帶著用希望編織而成的翅膀去冒險 但怎麼飛都飛不出現實的幻覺\r\n\r\n這種病毒會蔓延\r\n\r\n\r\n我開始慢慢的 把思緒轉變成空間 在灰色的世界 我找尋你的側臉\r\n\r\n就讓我 停留在陽光要綻放的那一秒\r\n\r\n那和栒不在盲目的力量\r\n\r\n\r\n我找尋遺留的腳步 微風和樹葉在飛舞\r\n\r\n我把難過都丟進湖  一切清楚 \r\n\r\n就讓我化作森林裡的一小段路 是迷霧\r\n\r\n都散了 想念把悲傷通通吹散了\r\n', '', 325, '', 'North Protect', '振剛', 'North Protect', '', '', 0, 0, 1, '2011-02-06 23:59:35', '2013-10-07 17:18:01', '0000-00-00 00:00:00'),
