(32557, 92272, 0, 1, 'Dreamer-Demo', '過去所能看到的景色，如今卻只能在夢裡相遇。', '2011-02-07 00:00:00', 2000, 0, 1, 5, '窗外的綠地 輕輕敲著我的風鈴 \r\n藍天和白雲 偷偷傾訴他的秘密 \r\nI open my eyes and to found dreamer \r\nbut where am I and where the light \r\nI also found it 綠色草地 \r\nI also found it 在美夢裡 \r\nI also found it 春風氣息 \r\nI also found it \r\n才剛下過雨 地面還在哭泣 \r\n時空又扭曲 又過了幾千世紀 \r\n', '', 244, '', 'The Third Party', 'SIN', '', '', '', 0, 0, 1, '2011-02-07 14:42:19', '2013-10-07 17:18:01', '0000-00-00 00:00:00'),
(32558, 57708, 0, 1, 'LOVE OF SECRET', '妳是否還在等待.執著一個未完的秘密.\r\n這首歌獻給等待的妳.\r\n', '2011-02-07 00:00:00', 2000, 0, 1, 13, '', '', 142, '', 'NOISY', '', '', '', '', 0, 1, 0, '2011-02-07 15:34:33', '2015-03-12 13:45:51', '0000-00-00 00:00:00'),
(32559, 35616, 0, 1, '犯錯 DEMO', '活在這世界  誰沒有犯過錯 但不要灰心 因為下次你將會更好', '2011-02-07 00:00:00', 2000, 0, 1, 1, 'Intro\r\nNO EVERY ONE  NO LISTEN MIND\r\n\r\nNO BODY CARE WHO AM I               X2\r\n\r\n在世界上 誰沒有犯過愚蠢的錯 \r\n沒有 犯過錯的人 請你們舉起雙手\r\n我要睜開 雙眼 來看看 再這裡 \r\n誰會舉起他那 可悲的雙手\r\n在我唱這 我寫的 譜的 新歌之前 \r\n也犯了不少年少無知 相同的錯 \r\n但不能說聲抱歉 就可以從頭來過\r\n因為 現實無情 會讓你 ㄧ無所有\r\n那些 被定義犯錯 是個有罪的人 \r\n到底是他 愚蠢 還是 他媽另有一愁\r\n或許再創造 一個機會 GIVE TO HIM \r\n就會像童話故事裡 那個王子一樣\r\n現在由我 江sir 拿著我的曼克風\r\n來唱出這 ㄧ切 ㄧ切的 fuck the show\r\n像那些 還在自以為行的 說聲 \r\n告訴你 甚麼 是我的 new style\r\n[dub]\r\nThe song true be all right\r\n[chorus]\r\nbe the face 在破碎還有分離噩夢的世界\r\nbe the face 在揮手卻剩失落絕望的應對\r\nbe the face 在破碎還有分離噩夢的世界\r\nbe the face 在揮手卻剩失落絕望的應對  X2\r\nevery broken want to change mine  我曾犯錯\r\nevery broken want to change mine  一切拋開 \r\n從前有個男孩 his name call’s the shu\r\n從他的眼睛 看到只是ㄧ個苗小的我\r\n他對我不顧一屑 讓我噁心 也想吐\r\n所以現在 拿起 曼克風 對他說 呜\r\n時間即將證明 誰會有擁有這一切 \r\n而是現在能站在 這舞臺上的耀雀\r\n不知道 能不能像他ㄧ樣 喊shit\r\n因為 我曾經也是一個 犯錯的人\r\n現在面對一切犯錯的過去\r\n在算著 還有 多少時間能復癒\r\n是不是能拿出勇氣 忘記過去\r\n還是會像隻 烏龜一樣 縮起頭來\r\n周杰倫的歌 四面楚割 有說過一句\r\n甚麼雜七雜八的事 都即將會流去\r\n唯有音樂 音樂 is not die away\r\nThis song to every wrong people\r\n[dub]\r\nThe song true all be right\r\n[chorus]\r\nbe the face 在破碎還有分離噩夢的世界\r\nbe the face 在揮手卻剩失落絕望的應對\r\nbe the face 在破碎還有分離噩夢的世界\r\nbe the face 在揮手卻剩失落絕望的應對  X2\r\n在世界上 誰沒有犯過愚蠢的錯 \r\n沒有 犯過錯的人 請你們舉起雙手\r\n我要睜開 雙眼 來看看 再這裡 \r\n誰會舉起他那 可悲無知的雙手\r\n\r\n犯錯  let off   pla  so    世界上誰沒有犯過愚蠢的錯\r\n', '', 276, '', 'Evolution Man', 'Ryan', 'Evolution Man', '', '', 0, 0, 1, '2011-02-07 16:20:36', '2013-10-07 17:18:01', '0000-00-00 00:00:00'),
