(32622, 47669, 0, 1, '煞到你', '', '2011-02-08 00:00:00', 2000, 0, 1, 7, '小姐請問北門路怎麼走\r\n我來自台北現在啥米龍不懂\r\n初來貴寶地是人生地不熟\r\n看你慈眉善目請你幫幫我\r\n唉呦你好像我大學同學\r\n是否咱有曾經見過面\r\n來日方長哪係方便\r\n留一下電話讓我們見個面\r\n\r\n煞到你煞到你我真正煞到你\r\n你像天上的星閃閃爍爍\r\n你有迷人氣質勾到我的心\r\n三魂七魄完全都給你\r\n\r\n人說重情重義中粉味\r\n這次我是真正撩下去\r\n沒有什麼是不得已\r\n一切都是發自我內心\r\n小姐你別生氣別離開\r\n一切因緣龍係天註定\r\n放下你的成見請你仔細聽\r\n我有心聲要告訴你\r\n放未記 放未記我完全 放未記\r\n我的腦海完全是你\r\n\r\n你的香味迷人帶走我的心\r\n讓我一切隆交給你\r\n煞到你煞到你我是真的煞到你\r\n你像天上的星閃閃爍爍\r\n你有迷人氣質勾到我的心\r\n三魂七魄完全都給你\r\n\r\n煞到你煞到你我是真的煞到你\r\n你像天上的星閃閃爍爍\r\n你有迷人氣質勾到我的心\r\n三魂七魄完全都給你\r\n放未記 放未記我是完全 放未記\r\n我的生活完全是你\r\n你的香味迷人帶走我的心\r\n讓我一切隆交給你\r\n\r\n', '', 190, '', '憤怒的螞蟻', '憤怒的螞蟻', '', '', '', 0, 1, 0, '2011-02-08 22:34:31', '2015-03-12 13:45:53', '0000-00-00 00:00:00'),
(32623, 47669, 0, 1, 'Patrick Star', '', '2011-02-08 00:00:00', 2000, 0, 1, 7, '喔～\r\n照著那面鏡\r\n誰試鏡中那個你\r\n大口去呼吸\r\n嗚～\r\n煩惱全忘記\r\n別丟了自己的自己\r\n用力的吐氣\r\n\r\n兒時的記憶\r\n海洋的香氣\r\n記憶猶新\r\n奔跑的沙地\r\n微笑的回應\r\n一如往昔\r\n嘴中的香甜\r\n眼中的苦澀\r\n體會深切\r\n心頭的糾結\r\n宣洩的排解\r\n自在發揮\r\n\r\n喔～\r\n照著那面鏡\r\n誰試鏡中那個你\r\n大口去吸氣\r\n嗚～\r\n煩惱全忘記\r\n別丟了自己的自己\r\n用力的吐氣\r\n\r\n喔～\r\n照著那面鏡\r\n誰試鏡中那個你\r\n大口去吸氣\r\n嗚～\r\n煩惱全忘記\r\n別丟了自己的自己\r\n用力的吐氣\r\n\r\n忘記一切跟著深呼吸 \r\n忘記一切跟著我呼吸\r\n', '', 234, '', '憤怒的螞蟻', '憤怒的螞蟻', '', '', '', 0, 1, 0, '2011-02-08 22:35:01', '2015-03-12 13:45:53', '0000-00-00 00:00:00'),
(32624, 47669, 0, 1, '一言難盡', '', '2011-02-08 00:00:00', 2000, 0, 1, 7, '腳邊的花   天上的鳥仔    有什麼能說出我的心聲\r\n窗外的天   水中的石仔    有什麼能藏著我的不耐\r\n剩你跟我   兩個有夢的人   一句話都沒講\r\n千言萬語    在這個時候     一個字都講不出聲\r\n\r\n熱情的水   赤燄的光    有什麼能打開我的緊張\r\n生份的風   畏冷的日頭     有什麼能知道我要講出聲\r\n啊～一言難盡的夢   就要醒\r\n啊～說不出聲的字   就要消化   就要吞下肚\r\n剩你跟我   兩個人有夢   一句話都沒講\r\n千言萬語    在這個時候     一個字都講不出聲\r\n一言難盡的夢 一切放他去 不要再想起 刷刷去\r\n看是要掉樹頭 還是放水流 刷刷去\r\n', '', 312, '', '憤怒的螞蟻', '憤怒的螞蟻', '', '', '', 0, 1, 0, '2011-02-08 22:38:31', '2015-03-12 13:45:53', '0000-00-00 00:00:00'),
(32625, 35275, 0, 1, '亂練的~ 很吵的~~', '總之~~過年的時候無聊練的啦  \r\n人家都彈150   我彈到200去了    現在茫茫的咩~~  =_=aa  哈哈\r\n只花幾天練好的~~彈錯一定的啦  後嘿~~', '2011-02-08 00:00:00', 2000, 0, 2, 7, '', '', 135, '', '', '', '', '', '', 0, 1, 0, '2011-02-08 23:09:47', '2015-03-12 13:45:53', '0000-00-00 00:00:00'),
(32626, 73031, 0, 1, '當妳的HERO', '', '2011-02-06 00:00:00', 2010, 5, 0, 5, '喜歡的是 妳撒嬌像貓\r\n感動的是 為我下廚房\r\n你難過時 肩膀給你靠\r\n要當你的HERO\r\n\r\n這種滋味 愛情的蜜糖\r\n你的微笑 我難以抵擋\r\n刀山油鍋 甘心為你下\r\n你是我的GIRL\r\n\r\n浪漫的劇情 排山倒海\r\n有你在身邊 世界更精采 \r\n奇怪不奇怪 兩小無猜\r\n心甘又情願 給你一個未來\r\n\r\n小車小房 也能很美滿\r\n三餐路邊 偶而吃大餐\r\n兩人世界 神仙情侶般\r\n讓你 幸福 滿滿 \r\n\r\n浪漫的劇情 排山倒海\r\n有你在身邊 世界更精采 \r\n奇怪不奇怪 兩小無猜\r\n心甘又情願 給你一個未來\r\n\r\n這種滋味 愛情的蜜糖\r\n你的微笑 我難以抵擋\r\n刀山油鍋 甘心為你下\r\n你是我的GIRL\r\n我是你的HERO\r\n阿接著開始SOLO \r\n\r\n', '', 168, '', '王彰駿(將軍)', '蕭若穎', '王彰駿(將軍)', '', '', 0, 1, 0, '2011-02-09 01:37:45', '2015-03-12 13:45:53', '0000-00-00 00:00:00'),
(32627, 58278, 0, 1, '島國之名-demo', '大聲對世界喊出咱的名字!!!!! 我們是台灣!!!!!!!!!', '2011-02-09 00:00:00', 2011, 0, 2, 7, '大聲　對世界喊出咱的名\r\n嘸免驚　咱真正是一個國家\r\n無依無偎　無靠山\r\n因為對面一個流氓\r\n \r\n打拼　是為著島國來正名\r\n咱的名　不是台灣某是要叫啥\r\n阿六仔　共匪仔\r\n做人不通太過赤艷\r\n \r\n唱歌　唱出台灣人心聲\r\n免依賴　所有那些垃圾官\r\n看到共仔　就軟腳\r\n這款政府甘有較好\r\n \r\n卒仔 無想台灣只想對岸\r\n批批抖 恁母仔甘無生給你膽\r\n聽到六仔 就畏寒\r\n台灣人民甘袂火大\r\n \r\n台灣是咱的名 勇敢來大聲喊\r\n台灣是咱的名 咱嘸免驚 \r\n \r\n國民黨拼死捧連葩\r\n甘這好康 咱清楚看\r\n國民黨像魁儡尪仔\r\n不敢出聲 服從老大\r\n \r\n對外改名中華台北\r\n若無共仔靠杯袂煞\r\n阮若叫恁中國北京\r\n恁甘袂來感覺賭爛\r\n \r\n嗆聲  三不五時對咱恐嚇\r\n台灣人  才袂隨便被ㄏㄟˋ驚\r\n只有藍色的反背仔\r\n相爭要做中國的狗仔子\r\n \r\n看破  外來政權不只惡霸\r\n心不在這  整天只有想洞又想縫\r\n這麼多的支持者\r\n伊卻不認台灣的名', '', 242, '', '', '', '', '', '', 1, 1, 0, '2011-02-09 01:56:46', '2015-03-12 13:45:53', '0000-00-00 00:00:00'),
