(32629, 88839, 0, 2, 'Parallel Lines', '', '2010-12-08 00:00:00', 2010, 0, 1, 9, 'Under the Bright Shell, whether hiding soul\r\nHow can the gloomy soul is weak and unbearable?\r\nDid you see my hands and hearts bleeding (once) again ?\r\nWhy do you always turn a blind eye?\r\n\r\nYour shadow always lingered in my mind\r\nWhenever you heartless words against tender to my fragile heart\r\nI repeatedly told myself not fell into the hole\r\nWhy should I suffer for the pain of love?\r\n\r\nThis love of the rope, have trapped me can’t breathe\r\nThat you see it and distressed me\r\n\r\nThe infinite darkness of the road, I can not Escape it , I can not choose\r\nThe only time ,the final time you in my mind \r\n\r\nI want to draw a parallel line between you and my heart \r\nThe only time ,the final time , you in my mind ,a parallel line\r\n', '', 233, '', 'Melody', 'Melody', 'Speed', '', '', 0, 0, 1, '2011-02-09 03:48:33', '2013-10-07 17:18:02', '0000-00-00 00:00:00'),
(32630, 88839, 0, 4, '破繭', '', '2010-12-08 00:00:00', 2010, 0, 1, 9, '睜開雙眼看到 一 片 片 荒蕪景象 光怪陸離\r\nOh每顆眼淚隱藏著 過去回憶\r\n沈重枷鎖每一 步 都 是 痛楚且無 形\r\n走 一起走 一起逃離那黑暗的苦疾\r\n\r\n阿～～～阿～阿  是否美 好 前 程 在前方\r\n阿～～～勇敢面對 逃出那封鎖線 不再回首瞻望\r\n\r\n你是否在 猶豫呢？  你是否在 躊躇著？\r\n是否仍在 驚恐呢？  是否仍在 夢魘中 無法逃離\r\n\r\n我知道 恐懼心靈總負載空虛 \r\n讓世界充滿 情和心 化解哀傷與恐懼\r\n我知道 沒有什麼能比意志堅\r\n不妨充滿期待 邁步向前 尋找你的新世界\r\n\r\n你是否在 猶豫呢？  你是否在 躊躇著？\r\n是否仍在 驚恐呢？  是否仍在 夢魘中 無法逃離\r\n\r\n(Solo)\r\n\r\n燃燒的火炬中透露訊息\r\n堅信自己總能突破困境\r\n人生的路程困難重重\r\n別害怕 直到凋零\r\n\r\n(Solo)\r\n\r\n我知道 恐懼心靈總負載空虛 \r\n讓世界充滿 情和心 化解哀傷與恐懼\r\n我知道 沒有什麼能比意志堅\r\n不妨充滿期待 邁步向前 尋找你的新世界\r\n\r\n你現在還 猶豫呢？  你現在還 躊躇著？\r\n是否還在 驚恐呢？  不堪往事 拼了命 也要逃離\r\n\r\n睜開雙眼看到 一 片 片 荒蕪景象 光怪陸離\r\nOh~~每顆眼淚隱藏著 過去回憶\r\n沈重枷鎖每一 步 都 是 痛楚且無 形\r\n走 一起走 一起逃離那黑暗的苦疾\r\n', '', 368, '', 'Speed', 'Speed', 'Speed', '', '', 0, 0, 1, '2011-02-09 03:53:14', '2013-10-07 17:18:02', '0000-00-00 00:00:00'),
(32631, 88839, 0, 4, '黑霧', '', '2010-12-08 00:00:00', 2010, 0, 1, 9, '濃霧前 好似無法撥開這愁\r\n躲在事實的後頭 是什麼樣面孔\r\n\r\n想試著去了解為何被捉弄\r\n黑暗潮水般 無情侵蝕\r\n\r\n深淵、碎裂、反覆、無助\r\n我要如何逃脫這枷鎖\r\n\r\n黑暗主宰靈魂 無法掙脫 命運枷鎖\r\n撕扯、漩渦、幻滅、黑洞\r\n拋棄、掙脫、最後一搏\r\n\r\n在這暗黑的世界裡，有人聽到我的嘶吼嗎?\r\n就算被無情的踐踏，有人在意嗎?\r\n臉上、指尖沾滿了極度醜陋不堪的灰塵\r\n在這反覆深淵中，我又何嘗不想逃脫\r\n身旁都是冷酷陌生的靈魂 \r\n彷彿聽不到屬於自己的語言\r\n\r\nAH~~~~~~~~\r\n撕扯、掙脫、最後一搏\r\n', '', 208, '', 'Melody', 'Melody', 'Speed', '', '', 0, 0, 1, '2011-02-09 03:55:07', '2013-10-07 17:18:02', '0000-00-00 00:00:00'),
(32632, 88839, 0, 5, 'Parallel Lines (remix by Morimagic)', '', '2010-12-08 00:00:00', 2000, 0, 1, 9, 'Under the Bright Shell, whether hiding soul\r\nHow can the gloomy soul is weak and unbearable?\r\nDid you see my hands and hearts bleeding (once) again ?\r\nWhy do you always turn a blind eye?\r\n\r\nYour shadow always lingered in my mind\r\nWhenever you heartless words against tender to my fragile heart\r\nI repeatedly told myself not fell into the hole\r\nWhy should I suffer for the pain of love?\r\n\r\nThis love of the rope, have trapped me can’t breathe\r\nThat you see it and distressed me\r\n\r\nThe infinite darkness of the road, I can not Escape it , I can not choose\r\nThe only time ,the final time you in my mind \r\n\r\nI want to draw a parallel line between you and my heart \r\nThe only time ,the final time , you in my mind ,a parallel line\r\n', '', 232, '', 'Melody', 'Melody', 'Speed', '', '', 0, 0, 1, '2011-02-09 03:57:29', '2013-10-07 17:18:02', '0000-00-00 00:00:00'),
